Signal Expert este un produs de asigurare care oferă acoperiri de sănătate și asistență în caz de accident auto.
Prin intermediul aplicației mobile poți beneficia de următoarele servicii:

1. Pași standardizati de deschidere dosar de daună prin intermediul aplicației;

2. Asistență la deschiderea dosarului de daună prin intermediul call center (031)9997;

3. Tractare gratuită a autovehiculului atât pentru șoferul vinovat cât și pentru șoferul păgubit;

4. Programarea pentru constatare în fața ASIGURATORULUI ;

5. Reprezentarea atât a șoferului păgubit cât și a celui vinovat în fața asiguratorului;

6. Asistența beneficiarului despăgubirii în fazele întocmirii devizelor de reparații, alegerea soluțiilor ;

tehnice de reparație corespunzătoare și în alegerea unei unități service agreate de asigurator;

7. Monitorizarea reparației autovehiculului în service și raportarea ritmică către beneficiar a 

stadiului reparației (informări text și foto);

8. Notificarea beneficiarului privind data de ridicare a autovehiculului din service;

